import React from "react";

const TodoApp = () => {
  return (
    <div style={{ backgroundColor: "red", height: window.innerHeight }}>
      <div
        style={{
          height: 200,
          width: 400,
          backgroundColor: "green",
          alignContent: "center"
        }}
      >
        spHello World
      </div>
    </div>
  );
};

export default TodoApp;
